import{_ as e,c as a,o as t,d as r}from"./app.a4863d7a.js";const T=JSON.parse('{"title":"CTRL+F5 和 F5 两种刷新有什么区别","description":"","frontmatter":{},"headers":[{"level":2,"title":"一、刷新原理不同。","slug":"一、刷新原理不同。","link":"#一、刷新原理不同。","children":[]},{"level":2,"title":"二、服务端返回不同。","slug":"二、服务端返回不同。","link":"#二、服务端返回不同。","children":[]},{"level":2,"title":"三、刷新结果不同。","slug":"三、刷新结果不同。","link":"#三、刷新结果不同。","children":[]}],"relativePath":"other/matrix/refresh-page.md","lastUpdated":1676394338000}'),c={name:"other/matrix/refresh-page.md"},s=r('<h1 id="ctrl-f5-和-f5-两种刷新有什么区别" tabindex="-1">CTRL+F5 和 F5 两种刷新有什么区别 <a class="header-anchor" href="#ctrl-f5-和-f5-两种刷新有什么区别" aria-hidden="true">#</a></h1><h2 id="一、刷新原理不同。" tabindex="-1">一、刷新原理不同。 <a class="header-anchor" href="#一、刷新原理不同。" aria-hidden="true">#</a></h2><p>F5触发的HTTP请求的请求头中通常包含了If-Modified-Since 或 If-None-Match字段,或者两者兼有；</p><p>CTRL+F5触发的HTTP请求的请求头中没有上面的那两个头,却有Pragma: no-cache 或 Cache-Control: no-cache 字段,或者两者兼有。</p><h2 id="二、服务端返回不同。" tabindex="-1">二、服务端返回不同。 <a class="header-anchor" href="#二、服务端返回不同。" aria-hidden="true">#</a></h2><p>F5刷新服务端返回304 Not Modified；</p><p>Ctrl + F5刷新返回HTTP状态码200，原因是Ctrl+F5在发出请求时，会在请求消息头中加入Cache-Control:no-cache，Pragma:no-cache参数。</p><h2 id="三、刷新结果不同。" tabindex="-1">三、刷新结果不同。 <a class="header-anchor" href="#三、刷新结果不同。" aria-hidden="true">#</a></h2><p>F5刷新按钮只对当前页面进行刷新，只刷新本地缓存；</p><p>Ctrl + F5 的行为也是刷新页面，但是会把浏览器中的临时文件夹的文件删除再重新从服务器下载。</p><p>比如某网站更新了 style.css 文件，如果单纯按 F5 刷新，那么当前页面还是使用未修改的 style.css 文件内容，如果按 Ctrl + F5 就会重新从服务器下载 style.css 文件，并使用修改后的 style.css 文件。</p>',11),h=[s];function i(n,l,d,o,p,_){return t(),a("div",null,h)}const C=e(c,[["render",i]]);export{T as __pageData,C as default};
